	add("chaat", "{\"term\":\"chaat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Hindi \u0027cāṭ\u0027 चाट (tasting, a delicacy), from \u0027cāṭnā\u0027 चाटना (to lick), from Prakrit \u0027caṭṭei\u0027 चट्टेइ (to devour with relish, eat noisily).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any savory snack, sold from a roadside stall in India, or served as a starter in an Indian restaurant\", \"priority\":1}]}, \"synonyms\":{}}");

