	add("chaff", "{\"term\":\"chaff\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"{{Webster 1913}}From Middle english (1100-1500) \u0027chaf\u0027 from Old english (ca. 450-1100) \u0027ceaf\u0027 probably from a Proto-germanic {{m|gem-pro|*kaf-||to gnaw, chew}}, from Proto-indo-european {{m|ine-pro|*gep(h)-||jaw mouth}}. Akin to West Frisian \u0027tsjêf\u0027 w:Dutch language|Dutch \u0027kaf\u0027 w:German language|German \u0027kaff\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The inedible parts of a grain-producing plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"To separate out the \u0027\u0027chaff\u0027\u0027, early cultures tossed baskets of grain into the air and let the wind blow away the lighter chaff\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"So take the corn and leave the \u0027\u0027chaff\u0027\u0027 behind\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"By extension, any excess or unwanted material, resource, or person; anything worthless\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"There are plenty of good books on the subject, but take care to separate the wheat from the \u0027\u0027chaff\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027chaff\u0027\u0027 and ruin of the time\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Loose material, e.g. small strips of aluminum foil, dropped from aircraft specifically to interfere with radar detection\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Straw or hay cut up fine for the food of cattle\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"By adding \u0027\u0027chaff\u0027\u0027 to his corn, the horse must take more time to eat it. In this way \u0027\u0027chaff\u0027\u0027 is very useful\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Light jesting talk; banter; raillery\", \"priority\":12}]}, \"synonyms\":{}}");

	add("chaffinch", "{\"term\":\"chaffinch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chaff|finch|lang\u003den}}Image:Fringilla coelebs chaffinch male edit2.jpg|right|thumb|197px|A male \u0027\u0027chaffinch\u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small passerine bird, \u0027Fringilla coelebs, of the finch family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chagossian", "{\"term\":\"chagossian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Chagos|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the previous inhabitants of the Chagos Islands, British Indian Ocean Territory, who were deported by the British government in the late 1960s and early 1970s\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chagrin", "{\"term\":\"chagrin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\"], \"text\":\"From French \u0027chagrin|lang\u003dfr\u0027 () of uncertain origin.A prevalent theory in many dictionaries is that it came from a metaphorical use of Old french (842-ca. 1400) {{m|fro|chagrin||a type of roughened leather}},\u0026lt;ref\u0026gt;http://triggs.djvu.org/century-dictionary.com/cent2jpgframes.php?volno\u003d02\u0026amp;page\u003d0909\u0026lt;/ref\u0026gt; with the connection of roughness.Another theory, due to Gamillscheg, is that it derives from Old French {{m|fro|graigne||sadness, resentment, grief}}, from {{m|fro|graim||sorrowful}}, perhaps related to Old High German {{m|goh|gram||angry, fierce}}.\u0026lt;ref\u0026gt;http://dictionary.reference.com/browse/chagrin?s\u003dt\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Distress of mind caused by a failure of aims or plans, want of appreciation, mistakes etc; vexation or mortification\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027, w:Louisa May Louisa May Alcott, \u0027Rose In Bloom\u0027, ch. 8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"H]e alone knew how deep was the deluded man\u0027s \u0027\u0027chagrin\u0027\u0027 at the failure of the little plot which he fancied was prospering finely\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A type of leather or skin with a rough surface.\u0026lt;ref name\u003d\u0026quot;OED2\u0026quot;\u0026gt;\u0026lt;/ref\u0026gt\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chain", "{\"term\":\"chain\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"northern frisian\", \"Icelandic\", \"Latin\", \"low german\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027chaine\u0027 from Old french (842-ca. 1400) \u0027chaine\u0027 \u0027chaene\u0027 {{gloss|\u0026quot;chain\u0026quot;; Modern French: \u0027chaîne\u0027 }, from Latin {{m|la|catēna||chain}}, from Proto-indo-european {{m|ine-pro|*kat-||to braid, twist; hut, shed}}. Cognate with Northern frisian \u0027ketten\u0027 (chain) Dutch \u0027keten\u0027 (chain) Low german \u0027kede\u0027 (chain) German \u0027kette\u0027 (chain) Danish \u0027kæde\u0027 (chain) Swedish \u0027kedja\u0027 (chain) Icelandic \u0027keðja\u0027 (chain)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A series of interconnected rings or links usually made of metal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He wore a gold \u0027\u0027chain\u0027\u0027 around the neck\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A series of interconnected things\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027chain\u0027\u0027 of mountains\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027chain\u0027\u0027 of ideas, one leading to the next\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This led to an unfortunate \u0027\u0027chain\u0027\u0027 of events\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A series of stores or businesses with the same brand name\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"That \u0027\u0027chain\u0027\u0027 of restaurants is expanding into our town\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A number of atoms in a series, which combine to form a molecule\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"When examined, the molecular \u0027\u0027chain\u0027\u0027 included oxygen and hydrogen\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A series of interconnected links of known length, used as a measuring device\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A long measuring tape\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A unit of length equal to 22 yards. The length of a Gunter\u0027s surveying chain. The length of a cricket pitch. Equal to 20.12 metres. Equal to 4 rods. Equal to 100 links\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A totally ordered set, especially a totally ordered subset of a poset\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A sequence of linked house purchases, each of which is dependent on the preceding and succeeding purchase (said to be \u0026quot;broken\u0026quot; if a buyer or seller pull pulls out\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"That which confines, fetters, or secures; a bond\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027chains\u0027\u0027 of habit\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Driven down / To \u0027\u0027chains\u0027\u0027 of darkness and the undying worm\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Iron links bolted to the side of a vessel to bold the dead-eyes connected with the shrouds; also, the channels\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The warp threads of a web\", \"priority\":21}]}, \"synonyms\":{}}");

	add("chair", "{\"term\":\"chair\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{wikipedia|chair|chair (furniture)}}Image:Chair.png|thumb|right|A chair (item of furniture).Image:Schienenstühle, Laschenstoß.jpg|thumb|right|Chairs (rail supports on a railway).From Middle english (1100-1500) {{m|enm|chaire}}, {{m|enm|chaiere}}, {{m|enm|chaere}}, {{m|enm|chayre}}, {{m|enm|chayere}}, from Old french (842-ca. 1400) {{m|fro|chaiere}}, {{m|fro|chaere}}, from Latin {{m|la|cathēdra||seat}}, from Ancient greek (to 1453) \u0027καθέδρα\u0027 () from \u0027κατά\u0027 (down) + \u0027ἕδρα\u0027 (seat) Displaced native \u0027stool\u0027 and {{m|en|settle}}, which now have specific senses.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An item of furniture used to sit on or in comprising a seat, legs, back, and sometimes arm rests, for use by one person. Compare stool, couch, sofa, settee, loveseat and bench\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThere were many wooden \u0027\u0027chairs\u0027\u0027 for the bulk of his visitors, and two wicker arm\u0027\u0027chairs\u0027\u0027 with red cloth cushions for superior people. From the packing-cases had emerged some Indian clubs,\u0026amp;nbsp;[…], and all these articles\u0026amp;nbsp;[…] made a scattered and untidy decoration that Mrs. Clough assiduously dusted and greatly cherished\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d19|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dMeanwhile Nanny Broome was recovering from her initial panic and seemed anxious to make up for any kudos she might have lost, by exerting her personality to the utmost. She took the policeman\u0027s helmet and placed it on a \u0027\u0027chair\u0027\u0027, and unfolded his tunic to shake it and fold it up again for him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Chairperson\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"and takes a little too much on him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The seating position of a particular musician in an orchestra\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Blocks that support and hold railroad track in position, and similar devices\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One of two possible conformers of cyclohexane rings (the other being boat), shaped roughly like a chair\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The electric chair\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A distinguished professorship at a university\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"location\u003dLondon|date\u003d12 April page\u003dR11|passage\u003dIn 1928 w:Martin \u0026amp\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"91;Martin\u0026amp\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"93; Heidegger succeeded w:Edmund \u0026amp\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"91;Edmund\u0026amp\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"93; Husserl to take a \u0027\u0027chair\u0027\u0027 at Freiburg\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"An iron block used on railways to support the rails and secure them to the sleepers\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A vehicle for one person; either a sedan borne upon poles, or a two-wheeled carriage drawn by one horse; a gig\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Think what an equipage thou hast in air, / And view with scorn two pages and a \u0027\u0027chair\", \"priority\":18}]}, \"synonyms\":{}}");

	add("chainlet", "{\"term\":\"chainlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chain|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small chain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, Charlotte Brontë, \u0027Shirley\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Her pure white dress, her fair arms and neck, the trembling \u0027\u0027chainlet\u0027\u0027 of gold circling her throat, and quivering on her breast, glistened strangely amid the obscurity of the sickroom\", \"priority\":3}]}, \"synonyms\":{}}");

	add("chainring", "{\"term\":\"chainring\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chain|ring|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The large forward ring on a bicycle that a chain attaches to, in order to transfer energy to a wheel. A bicycle chainring consists of one or more sprockets that are driven by the cranks and pedals of the bicycle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chainsaw", "{\"term\":\"chainsaw\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|chain|saw|lang\u003den}} due to the chain cutting mechanism.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A saw that has a power-driven and fast-revolving chain of metal teeth, usually used to cut trees\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He used a \u0027\u0027chainsaw\u0027\u0027 to cut through the fallen tree on the roadway\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chairholder", "{\"term\":\"chairholder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chair|holder|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who holds the role of academic chair\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chairman", "{\"term\":\"chairman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|chair|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person (implied male) presiding over a meeting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The head of a corporate or governmental board of directors, a committee, or other formal entity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Someone whose job is to carry people in a portable chair, sedan chair, or similar conveyance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, p. 618\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Mr Western entered; but not before a small wrangling bout had passed between him and his \u0027\u0027chairmen\u0027\u0027; for the fellows, who had taken up their burden at the Hercules Pillars, had conceived no hopes of having any future good customer in the squire\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1836\u0027\u0027, Charles Dickens, \u0027The Pickwick Papers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Mr. Winkle, catching sight of a lady\u0027s face at the window of the sedan, turned hastily round, plied the knocker with all his might and main, and called frantically upon the \u0027\u0027chairman\u0027\u0027 to take the chair away again\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chairmanship", "{\"term\":\"chairmanship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chairman|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The office, or the term of a chairman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 John Gunn - Contested Skies: Trans-Australian Airline\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nixon proposed the establishment of an Aviation Industry Consultative Council under the \u0027\u0027chairmanship\u0027\u0027 of the permanent head of his department\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1891\u0027\u0027 Hansard\u0027s Parliamentary Debate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Afterwards, Sir Eardly Wilmot had been appointed, from whom, on account of his long \u0027\u0027chairmanship\u0027\u0027 of quarter-sessions, much had reasonably been expected\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chairwoman", "{\"term\":\"chairwoman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chair|woman|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female chairperso\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1845\u0027\u0027, \u0027\u0027The New Statistical Account of Scotland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At a Reform dinner which took place in 1832, the united ages of three women, including the \u0027\u0027chairwoman\u0027\u0027, amounted to 264\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A charwoma\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1812\u0027\u0027 The Works of the Rev. Jonathan Swift, D\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"according to her skill and qualifications, whether in the nature of a dairy-maid, a cook, or \u0027\u0027chairwoman\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chairwork", "{\"term\":\"chairwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chair|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A technique in which the patient moves between chairs, acting as a different person in each one, so as to understand the point of view of others\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A form of physical therapy that involves repeatedly sitting and standing so as to gauge one\u0027s posture\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chaise", "{\"term\":\"chaise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027chaise\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An open, horse-drawn carriage for one or two people, usually with one horse and two wheels\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1877\u0027\u0027, Chapter 22[http://en.wikisource.org/wiki/Black_Beauty/22\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The next morning after breakfast, Joe put Merrylegs into the mistress\u0027s low \u0027\u0027chaise\u0027\u0027 to take him to the vicarage; he came first and said good bye to us, and Merrylegs neighed to us from the yard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A chaise longue\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A post chaise.Category:en:Chairs\", \"priority\":5}]}, \"synonyms\":{}}");

