	add("chalk", "{\"term\":\"chalk\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) \u0027cealc\u0027 borrowed from Latin \u0027calx\u0027 (limestone) borrowed from Ancient greek (to 1453) \u0027χάλιξ\u0027 (pebble)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soft, white, powdery limestone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A piece of chalk, or, more often, processed compressed chalk, that is used for drawing and for writing on a blackboard\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"tailor\u0027s Tailor\u0027s chalk\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A white powdery substance used to prevent hands slipping from holds when climbing, sometimes but not always limestone-chalk\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A platoon-sized group of airborne soldiers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The prediction that there will be no upsets, and the favored competitor will win\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chalaza", "{\"term\":\"chalaza\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027χάλαζα\u0027 (hailstone, lump)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the two spiral bands which attach the yolk of an egg to the eggshell, suspending it in the egg white\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The location where the nucellus attaches to the integuments, opposite the micropyle\", \"priority\":2}]}, \"synonyms\":{}}");

