	add("chalazogamy", "{\"term\":\"chalazogamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process of fecundation in which the pollen tube penetrates to the embryo sac through the tissue of the chalaza, instead of entering through the micropyle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chalcanthite", "{\"term\":\"chalcanthite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From its old Latin name \u0027chalcanthum\u0027 \u0026quot;flowers of copper\u0026quot;.\u0026lt;ref\u0026gt;James D. Dana: \u0027Dana\u0027s System of Mineralogy. Volume II\u0027, seventh edition, revised by Charles Palache, Harry Berman, and Clifford Frondel. John Wiley \u0026amp; Sons, 1951\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mineral form of copper sulfate, Cusulfur|Soxygen|O\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chalcedon", "{\"term\":\"chalcedon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027calchēdōn\u0027 from Ancient greek (to 1453) \u0027χαλκηδών\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an ancient maritime town of Bithynia, in Asia Minor, almost directly opposite Byzantium\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chalcidology", "{\"term\":\"chalcidology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chalcid|ology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of chalcid wasps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027 — Gibson et al. \u0027Annotated Keys to the Genera of Nearctic Chalcidoidea (Hymenoptera)\u0027 (NRC Research Press\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The major milestone in Nearctic \u0027\u0027chalcidology\u0027\u0027 during the latter half of the 20th century is perhaps the catalog by Pec\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 — Systematic Entomolgy (1999) 24, 301-30\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The publication of this CD-ROM catalogue marks an important step in the history of \u0027\u0027chalcidology\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 — Simon van Noort and Jean-Yves Rasplus \u0027Revision of the Papua New Guinean fig wasp genus Robertsia Bouček (Hymenoptera: Chalcidoidea: Pteromalidae: Sycoecinae\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"This paper is dedicated to the doyen of \u0027\u0027chalcidology\u0027\u0027, Zdenek Bouček, in the year of his 81st birthday\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chalice", "{\"term\":\"chalice\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) from Anglo-norman from Old french (842-ca. 1400) {{m|fro|chalice}}, collateral form of {{m|fro|calice}}, borrowed from Latin \u0027calix\u0027 from Ancient greek (to 1453) \u0027κύλιξ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large drinking cup, often having a stem and base and used especially for formal occasions and religious ceremonies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1612\u0027\u0027, w:William William Shakespeare, \u0027Macbeth\u0027 (First Folio), act 1, scene 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This euen-handed Iuſtic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Commends th\u0027Ingredience of our poyſon\u0027d \u0027\u0027Challice\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"To our owne lips\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chalicosis", "{\"term\":\"chalicosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027χάλιξ|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of pneumoconiosis affecting the lungs or bronchioles, found chiefly among stonecutters\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chalkboard", "{\"term\":\"chalkboard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|chalk|board|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"right|thum\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A slate board for writing on with chalk; a predecessor to a whiteboard\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chalmette", "{\"term\":\"chalmette\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Named for its founder, {{w|Louis-Xavier Martin de Lino de Chalmette}}, from French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A town in southeastern Louisiana in the United States of America\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chalumeau", "{\"term\":\"chalumeau\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027chalumeau\u0027 from Latin \u0027calamellus\u0027 diminutive of \u0027calamus|lang\u003dla\u0027 () from Ancient greek (to 1453) \u0027κάλαμος\u0027 (reed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woodwind instrument which was the predecessor of the clarinet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The lowest range of the clarinet, reaching up to written B♭ (B flat) above middle C\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chalypsography", "{\"term\":\"chalypsography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"steel-engraving\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chamade", "{\"term\":\"chamade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\", \"Portuguese\"], \"text\":\"From French French|chamade\u0027, from Italian or Portuguese from Latin \u0027clamare\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A signal sounded on a drum or trumpet inviting a parley\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1762\u0027\u0027, Laurence Sterne, \u0027The Life \u0026amp; Opinions of Tristram Shandy, Gentleman\u0027, volume 6 (Penguin 2003), page 402\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But when the \u0027\u0027\u0027chamade\u0027\u0027\u0027 was beat, and the corporal helped my uncle up it, and followed with the colours in his hand, to fix them upon the ramparts\", \"priority\":3}]}, \"synonyms\":{}}");

	add("chamaephyte", "{\"term\":\"chamaephyte\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"English\"], \"text\":\"From Danish {{m|da|kamæfyt}}, {{m|da|chamæfyt}}, equivalent to {{confix|chamae|phyte|t1\u003dground|t2\u003dplant|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any low perennial plant whose buds overwinter just above soil level\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chamar", "{\"term\":\"chamar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\"], \"text\":\"From Hindi \u0027चमार\u0027 (tr\u003dcamār)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of a Hindu caste who works in leather; a tanner or leather-worker\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘The Sending of Dana Da’, \u0027In Black and White\u0027, Folio Society 2005, page 419\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is not strictly a native patent, though \u0027\u0027\u0027chamars\u0027\u0027\u0027 of the skin and hide castes can, if irritated, despatch a Sending which sits on the breast of their enemy by night and nearly kills him\", \"priority\":3}]}, \"synonyms\":{}}");

	add("chambermaid", "{\"term\":\"chambermaid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chamber|maid|lang\u003den}}.\u0026lt;!--see these two for more etymology--\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A maid who handles the chores in a bedroom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chambermate", "{\"term\":\"chambermate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|chamber|mate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who shares a chamber or room\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chambira", "{\"term\":\"chambira\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a type of palm native to the Amazon rain forest, or the wood of this tre\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chametz", "{\"term\":\"chametz\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient hebrew\"], \"text\":\"Transliteration of Ancient hebrew {{m|he|חמץ||leavened bread, leaven, ferment, corruption, extortion}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Food made from leavened grain flour. The Torah states that Jews are not permitted to eat or drink it during the festival of Pesach (Passover), nor own it or even be seen with it, but must remove it from their houses and land at the beginning of the festival\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c.1998:\u0027\u0027 Rabbi Y D Webster, \u0027The Halachos of Pesach [http://web.archive.org/web/20000817182731/http://users.aol.com/rabbiyd/bedika.htm\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1_2]\u0027 - Any flour of the five species of grain (wheat, spelt, oats, barley and rye) ... which becomes mixed with water and allowed to ferment for more than eighteen minutes before being baked is considered \u0027\u0027chometz\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"a.2006:\u0027\u0027 Rabbi Lawrence Rigal, \u0027Jewish Customs and Practices: Pesach (Passover) [http://web.archive.org/web/20020201220213/http://www.rigal.freeserve.co.uk/jewish/passover/pesach.htm]\u0027 - All \u0027\u0027chamets\u0027\u0027 found is carefully bundled up and taken outside and burnt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a.2006:\u0027\u0027 London Borough of Barnet, UK, \u0027Street Cleaning Programme: Special Services [http://www.barnet.gov.uk/street-cleaning-programm\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"specialservices]\u0027 - Every year we provide skips for the Jewish community to dispose of \u0027\u0027chometz\u0027\u0027 (Passover waste\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027The Press, Barnet and Whetstone edition 6 April 2006\u0027 - The [Barnet council] skips are to be used only to dispose of \u0027\u0027chometz\u0027\u0027 and will be clearly marked\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Arrogance, pride, artifice (this usage is based on a disputed translation of the Hebrew source word\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Rabbi Zeitlin, Congregation Beth Ha\u0027ari, \u0027Pesach 2000: Chametz [http://www.congregationbethhaari.org/hzchametz2000.htm]\u0027 - The real chametz we want to eliminate is that within our personalities and actions\", \"priority\":9}]}, \"synonyms\":{}}");

	add("chamfer", "{\"term\":\"chamfer\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027chanfrein\u0027 from Latin \u0027frenum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an obtuse-angled relief or cut at an edge added for a finished appearance and to break sharp edges\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chamfron", "{\"term\":\"chamfron\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027chanfrain\u0027 presumably from \u0027champ\u0027 + \u0027frein\u0027 (bit (between a horse\u0027s teeth))\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Protective armor for a horse\u0027s head, especially the face and ears\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027A Clash of Kings\u0027, Bantam 2011, p. 555\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His charger wore a blanket of enameled crimson scales and gilded crinet and \u0027\u0027chamfron\u0027\u0027, while Lord Tywin himself sported a thick ermine cloak\", \"priority\":3}]}, \"synonyms\":{}}");

	add("chamicuro", "{\"term\":\"chamicuro\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an indigenous people of Peru, South Americ\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"their language, which is a member of Western Maipuran of the Arawakan family\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chamois", "{\"term\":\"chamois\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old high german (ca. 750-1050)\"], \"text\":\"{{borrowing|fr|en|lang\u003den}} {{m|fr|chamois}}, from Gaulish {{m|cel-gau|camox}} (5th c., Polemius Silvius), probably from an extinct Alpine language (Raetic, Ligurian). Compare also Old high german (ca. 750-1050) {{m|goh|gamiza||chamois}} (whence modern German \u0027gämse\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Rupicapra rupicapra thumb|\u0027Rupicapra rupicapra\u0027 (1\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A short-horned goat antelope native to mountainous terrain in southern Europe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Soft pliable leather originally made from the skin of chamois (nowadays the hides of deer, sheep, and other species of goat are alternatively used\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The traditional colour of chamois leather\", \"priority\":4}]}, \"synonyms\":{}}");

	add("champagne", "{\"term\":\"champagne\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|champagne|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sparkling white wine made from a blend of grapes, especially Chardonnay and pinot, produced in Champagne by the méthode champenois\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"any variety of champagne\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A glass of champagne\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any sparkling white wine\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A very pale brownish-gold colour, similar to that of champagne\", \"priority\":5}]}, \"synonyms\":{\"list\":[{\"text\":\"bubbly\", \"synonymQualifier\":\"INFORMAL\"},{\"text\":\"champansky\", \"synonymQualifier\":\"INFORMAL\"},{\"text\":\"champers\", \"synonymQualifier\":\"INFORMAL\"},{\"text\":\"fizz\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("champaign", "{\"term\":\"champaign\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027champaigne\u0027 from Latin {{m|la|campānia}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Open countryside, or an area of open countryside\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And therwith torned theyr horses and rode ouer waters and thurgh woodes tyl they came to theyre busshement / where as syr Lyonel and syr Bedeuer were houyng / The romayns folowed fast after on horsbak and on foote ouer a \u0027\u0027chāpayn\u0027\u0027 vnto a wood\u0026lt;!--Prior quote\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then the Romaynes followed faste on horsebak and on foote over a fayre \u0027\u0027champeyne\u0027\u0027 unto a fayre wood.--\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027, William Shakespeare, \u0027King Lear\u0027, I.i\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Of all these bounds even from this line to this, / With shadowy forests and with \u0027\u0027champaigns\u0027\u0027 riched, / With plenteous rivers and wide-skirted meads, / We make thee lady\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"II.ii.3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"So Segrave in Leicestershireis sited in a \u0027\u0027champaign\u0027\u0027 at the edge of the wolds, and more barren than the villages about it, yet no place likely yields a better air\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A battlefield\", \"priority\":8}]}, \"synonyms\":{}}");

	add("champansky", "{\"term\":\"champansky\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|champagne|sky|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Imitation champagne, chiefly Russian in origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027, Eddy Gilmore, [http://books.google.ca/books?id\u003d721bAAAAIAAJ\u0026amp;q\u003dchampansky\u0026amp;dq\u003dchampansky\u0026amp;hl\u003dfr\u0026amp;ei\u003dLUM8TKmdFcG88gaSk82TBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDgQ6AEwAw \u0027After the Cossacks burned down the “Y”\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Because it\u0027s like you, it’s so Russian. I even like the way you Russians say it, \u0027\u0027champansky\", \"priority\":3}]}, \"synonyms\":{}}");

	add("champer", "{\"term\":\"champer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|champ|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one who champs or bites\", \"priority\":1}]}, \"synonyms\":{}}");

	add("champers", "{\"term\":\"champers\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Champagne (wine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chank", "{\"term\":\"chank\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The large spiral shell of several species of sea conch, much used in making bangles, especially\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chancel", "{\"term\":\"chancel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|chancel}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The space around the altar in a church, often enclosed, for use by the clergy and the choir. In medieval cathedrals the chancel was usually enclosed or blocked off from the nave by an altar screen\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chancellor", "{\"term\":\"chancellor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027chaunceler\u0027 from Old french (842-ca. 1400) \u0027chancelier\u0027 from \u0027cancellarius\u0027 a director of chancery, from Latin \u0027\u0027 (cancelli lattices) See \u0027chancel\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A judicial court of chancery, which in England and in the United States is distinctively a court with equity jurisdiction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Head of a chancery\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An important notary; a person in charge of some area of government, often justice or finance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The head of a university, sometimes purely ceremonial\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The head of parliamentary government in some German speaking countries\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A record keeper for a diocese or equivalent religious area\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Foreman of a jury\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Chancellor of the Exchequer\", \"priority\":8}]}, \"synonyms\":{}}");

	add("chancellorship", "{\"term\":\"chancellorship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chancellor|ship|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The status of being a chancellor\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chancer", "{\"term\":\"chancer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scheming opportunist\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chancre", "{\"term\":\"chancre\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|chancre||cancer|lang\u003den}}, from Latin {{m|la|cancer}}, originally meaning “crab”. Cognate to \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Skin lesion, sometimes associated with certain contagious diseases such as syphilis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chandelier", "{\"term\":\"chandelier\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French from Latin \u0027candelabrum\u0027 from \u0027candela\u0027 () see candle.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branched, often ornate, lighting fixture suspended from the ceilin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, w:M. Barnard M. Barnard Eldershaw, \u0027w:A House is A House Is Built\u0027, Chapter VII, Section v\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She opened the drawing-room door in trepidation. Would she find Esther drowned with her head in the goldfish bowl, or hanged from the \u0027\u0027chandelier\u0027\u0027 by her stay-lace\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fictional bidder used to increase the price at an auction. Also called a wall\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Frank Pope, \u0026quot;Dragon Sea: a true tale of treasure, archeology, and greed off the coast of Vietnam\u0026quot;, Harcourt Books, p. 306\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A mysterious phone bidder was grabbing the pieces that no one else wanted—Mensun suspected this was the auction house \u0026quot;bidding against the chandelier,\u0026quot; protecting itself against selling too low\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A portable frame used to support temporary wooden fences\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1747\u0027\u0027, w:James James Boswell, \u0027The Scots Book\u0027, volume 9, p. 37. [http://books.google.com/books?id\u003dFVwAAAAAYAAJ\u0026amp;dq\u003dchandelier%20is%20a%20wooden%20frame\u0026amp;pg\u003dPA3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dchandelier%20is%20a%20wooden%20frame\u0026amp;f\u003dfalse\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Chandelier\u0027\u0027\u0027. A wooden frame, whereon are laid fascines or faggots, to cover the workmen in making approaches\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Todd A. Shallat, \u0027Structures in the Stream: Water, Science, and the Rise of the U. S. Army Corps of Engineers\u0027, University of Texas Press, p. 32\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Europeans solved this problem by building a temporary fence with tightly bound sticks (\u0026quot;fascines\u0026quot;) stacked into wooden frames (\u0026quot;\u0027\u0027chandeliers\u0027\u0027\u0026quot\", \"priority\":12}]}, \"synonyms\":{}}");

	add("changeableness", "{\"term\":\"changeableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|changeable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the condition of being changeabl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the condition of being able to suffer some changes\", \"priority\":2}]}, \"synonyms\":{}}");

	add("changer", "{\"term\":\"changer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|change|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone or something who changes things\", \"priority\":1}]}, \"synonyms\":{}}");

	add("changeset", "{\"term\":\"changeset\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|change|set|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A set of changes, as in source control\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, James Avery, Jim Holmes, \u0027Windows developer power tools\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027changeset\u0027\u0027 can be one specific set of changes to code — say, a bugfix patch — or a grouping of other changesets or groups of revisions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Bryan O\u0027Sullivan, \u0027Mercurial: The Definitive Guide\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This hook does not have any information about the \u0027\u0027changesets\u0027\u0027 to be added, because it is run before transmission of those changesets is allowed to begin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Jon Loeliger, \u0027Version Control with Git\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Every Git commit represents a single, atomic \u0027\u0027changeset\u0027\u0027 with respect to the previous state\", \"priority\":7}]}, \"synonyms\":{}}");

