	add("chanoyu", "{\"term\":\"chanoyu\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"Japanese \u0027茶の湯\u0027 (tr\u003dちゃのゆ, cha no yu)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traditional Japanese tea ceremony in which matcha is prepared and presented\", \"priority\":1}]}, \"synonyms\":{}}");

