	add("chanter", "{\"term\":\"chanter\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\"], \"text\":\"{{-er|chant}}. Compare French \u0027chanteur\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who chants or sing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A priest who sings in a chantr\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The pipe of a bagpipe on which the melody is playe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The hedge sparrow\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chanterelle", "{\"term\":\"chanterelle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|chanterelle|lang\u003den}}, from \u0027cantharellus\u0027 diminutive of Latin \u0027cantharus\u0027 (drinking vessel)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A widely distributed edible mushroom, \u0027Cantharellus cibarius\u0027, being yellow and trumpet-shaped; or any similar mushroom of the genera \u0027Cantharellus\u0027, or , not all of which are edible\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, Angela Carter, ‘The Erl-King’, \u0027The Bloody Chamber\u0027, Vintage 2006, p. 98\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even the homely wood blewits, that you cook like tripe, with milk and onions, and the egg-yolk yellow \u0027\u0027chanterelle\u0027\u0027 with its fan-vaulting and faint smell of apricots, all spring up overnight like bubbles of earth, unsustained by nature, existing in a void\", \"priority\":3}]}, \"synonyms\":{}}");

	add("chaoite", "{\"term\":\"chaoite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supposed allotrope of carbon whose existence is disputed\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chaomancy", "{\"term\":\"chaomancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) (Paracelsian) \u0027chaos\u0027, \u0026quot;the atmosphere\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination by aerial visions. A form of aeromancy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1650\u0027\u0027 French tr. Paracelsus Nine Books Of the Nature of Things (1674) ix\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Chaomancy\u0027\u0027 shews its Signs by the Stars of the Air and Wind, by the discolouring, destroying of all tender and subtil things ... If the Stars of Chaomancy are moved, Spirits fall from the superiour Air, and Voices and Answers were often heard ... There are seen Hobgoblins, Household Gods, airy Spirits, and Woodmen, \u0026amp;c. also a heavenly Dew and Manna falls upon Trees and Herbs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1908\u0027\u0027 Funk \u0026amp; Wagnalls Standard Dict. i\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chaomancy\u0027\u0027...Fortune-telling by aerial apparitions\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chaotropism", "{\"term\":\"chaotropism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) {{m|grc|χάος||vast chasm, void}} (English {{m|en|chaos}}) {{suffix||tropism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to disrupt hydrogen bonding, especially within or between biological molecule\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The chaotropism of chlorate is greater than that of sulfate\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chaparral", "{\"term\":\"chaparral\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Basque\"], \"text\":\"From Spanish \u0027chaparral\u0027 from \u0027chaparro\u0027 + \u0027-al\u0027 from Basque \u0027txaparro\u0027 from \u0027txapar\u0027 from \u0027saphar\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A region of shrubs, typically dry in the summer and rainy in the winter. The coast of the Mediterranean is such a region\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, \u0027The Understanding Heart\u0027, Chapter I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was quite dark when, after an arduous climb, the sheriff made his tortuous way through the \u0027\u0027chaparral\u0027\u0027 to the point where Anthony Garland should be stationed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The foliage of creosote bush, when used as a medicinal herb\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chapati", "{\"term\":\"chapati\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\", \"Sanskrit\"], \"text\":\"From Hindi \u0027चपाती\u0027 from Sanskrit \u0027चर्पटी\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat, unleavened bread from northern India and Pakistan\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chapeau", "{\"term\":\"chapeau\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|chapeau|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cap of maintenance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The mass of grape solids that floats on the surface during the fermentation of wine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In international law, introductory text appearing in a treaty that broadly defines its principles, objectives, and background.Category:en:Headgear\", \"priority\":4}]}, \"synonyms\":{}}");

	add("chapel", "{\"term\":\"chapel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027chapele\u0027 from \u0027cappella\u0027 () diminutive of \u0027cappa\u0027 () * \u0026lt;span style\u003d\u0026quot;font-size:85%;\u0026quot;\u0026gt;‘{{w|Martin of Tours|Martin}} was said to have torn his military cloak in half to clothe a poor man, who was later revealed to him as Christ himself. The cut down “little cloak”, \u0027cappella\u0027 in Latin, later became one of the most prized possessions of the Frankish barbarian rulers who succeeded Roman governors in Gaul, and the series of small churches or temporary structures which sheltered this much-venerated relic were named after it: \u0027capellae\u0027 ’ ({{w|Diarmaid MacCulloch}}, \u0027A History of Christianity\u0027, Penguin 2010, p. 313)\u0026lt;/span\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place of worship, smaller than, or subordinate to a church\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A place of worship in a civil institution such as an airport, prison etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dOne saint\u0027s day in mid-term a certain newly appointed suffragan-bishop came to the school \u0027\u0027chapel\u0027\u0027, and there preached on “The Inner Life.”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A funeral home, or a room in one for holding funeral services\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A trade union branch in UK printing or journalism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A printing office, said to be so called because printing was first carried on in England in a chapel near Westminster Abbey\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A choir of singers, or an orchestra, attached to the court of a prince or nobleman\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chaperon", "{\"term\":\"chaperon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\"], \"text\":\"From French \u0027chaperon\u0027 (hood) from Middle french (ca. 1400-1600) \u0026quot;head covering\u0026quot;, from \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An adult who accompanies or supervises one or more young, unmarried men or women during social occasions, usually with the specific intent of preventing some types of social or sexual interactions or illegal behavior\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A hood, especially, an ornamental or official hood\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Howel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"His head and face covered with a \u0027\u0027chaperon\u0027\u0027, out of which there are but two holes to look through\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A device placed on the foreheads of horses which draw the hearse in pompous funerals\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chaperonage", "{\"term\":\"chaperonage\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a chapero\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The protection offered by a chaperon\", \"priority\":2}]}, \"synonyms\":{}}");

	add("chapess", "{\"term\":\"chapess\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chap|ess|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female chap; a woman\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Samuel Gorley Putt, \u0027Wings of a Man\u0027s Life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My friends are the undergraduates, chaps and \u0027\u0027chapesses\u0027\u0027, and as long as I can pour good wine down their gullets and listen into the small hours\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, James Hawes, \u0027Speak for England\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"so naturally, we simply couldn\u0027t afford to have chaps and \u0027\u0027chapesses\u0027\u0027 tying the knot and then not having babies after all that fuss\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Mark Simpson, \u0027Saint Morrissey\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Those revered as saints are usually very peculiar chaps and \u0027\u0027chapesses\u0027\u0027 who succeeded in refusing life just short of actually killing themselves\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chaplain", "{\"term\":\"chaplain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|chapelain}}, from {{m|la|cappellānus}}, from {{m|la|cappella}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the clergy officially assigned to an institution, group, private chapel, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chaplin", "{\"term\":\"chaplin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"An occupational surname for a \u0027chaplain\u0027 from Middle english (1100-1500) and Old french (842-ca. 1400) \u0027chapelain\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"w:Charlie Sir Charles Spencer \u0026quot;Charlie\u0026quot; Chaplin (1889–1977), English comic actor and film director of the silent film era\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chapman", "{\"term\":\"chapman\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle low german\", \"Swedish\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|cēapmann||dealer}} (cognate with synonymous German \u0027kaufmann\u0027 Middle low german \u0027kopman\u0027 Swedish \u0027köpman\u0027 , from {{m|ang|cēap||barter, business, dealing}} (whence also \u0027\u0027 and \u0027mann\u0027 (man)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a dealer or merchant, especially an itinerant one\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chappaqua", "{\"term\":\"chappaqua\", \"etymology\":{\"influencers\":[], \"languages\":[\"algonquin\", \"English\"], \"text\":\"Algonquin {{m|alq|shah-pah-ka|}}{{etystub|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hamlet in Westchester County, New York\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chappy", "{\"term\":\"chappy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chap|y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chap; a fellow\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chaptalization", "{\"term\":\"chaptalization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after w:Jean-Antoine Chaptal|Jean-Antoine Chaptal, who developed the process.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the addition of sugar to grape juice in the fermentation of wine. Usually done if the grapes are thought to lack enough natural sugars for the desired alcohol content\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chapter", "{\"term\":\"chapter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027chapiter\u0027 from Old french (842-ca. 1400) \u0027chapitre\u0027 from Latin \u0027capitulum\u0027 (a chapter of a book, in {{etyl) also a synod or council}}, diminutive of \u0027caput\u0027 () see chapiter and capital, which are doublets of \u0027chapter\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the main sections into which the text of a book is divided\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"At her invitation he outlined for her the succeeding \u0027\u0027chapters\u0027\u0027 with terse military accuracy ; and what she liked best and best understood was avoidance of that false modesty which condescends, turning technicality into pabulum\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A section of a social or religious body\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An administrative division of an organization, usually local to a specific area\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An assembly of monks, or of the prebends and other clergymen connected with a cathedral, conventual, or collegiate church, or of a diocese, usually presided over by the dean\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A community of canons or canonesses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bishop\u0027s council\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An organized branch of some society or fraternity, such as the Freemasons\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A meeting of certain organized societies or orders\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A chapter house\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A sequence (of events), especially when presumed related and likely to continue\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1866\u0027\u0027, \u0027s:Armadale/Book the Last/Chapter Armadale\u0027, Book the Last, Chapter I\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"quot;You know that Mr. Armadale is alive,\u0026quot; pursued the doctor, \u0026quot;and you know that he is coming back to England. Why do you continue to wear your widow\u0027s dress?\u0026quot; \u0026amp;para; She answered him without an instant\u0027s hesitation, steadily going on with her work. \u0026amp;para; \u0026quot;Because I am of a sanguine disposition, like you. I mean to trust to the \u0027\u0027chapter\u0027\u0027 of accidents to the very last. Mr. Armadale may die yet, on his way home.\u0026quot\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, \u0027s:The Lair of the White Worm/Chapter The Lair of the White Worm\u0027, Ch.26\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"she determined to go on slowly towards Castra Regis, and trust to the \u0027\u0027chapter\u0027\u0027 of accidents to pick up the trail again\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A decretal epistle\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A location or compartment\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"In his bosom! In what \u0027\u0027chapter\u0027\u0027 of his bosom\", \"priority\":19}]}, \"synonyms\":{}}");

	add("chare", "{\"term\":\"chare\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027chare\u0027 variant (due to the verb form \u0027charen\u0027 of \u0027char\u0027 \u0027cher\u0027 (a turn) from Old english (ca. 450-1100) {{m|ang|ċierr}}, {{m|ang|ċerr||a turn, change, time, occasion, affair, business}}, from Proto-germanic {{m|gem-pro|*karzijaną||to turn, sweep}}, from Proto-indo-european {{m|ine-pro|*gers-||to turn, bend}}. More at {{l|en|char}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A narrow lane or passage between houses in a town\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chart", "{\"term\":\"chart\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027charte\u0027 (lang\u003dfrm) from \u0027charta\u0027 (lang\u003dla) Latin (\u0026quot;papyrus, writing\u0026quot;), from Ancient greek (to 1453) \u0027χάρτης\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A map\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A map illustrating the geography of a specific phenomenon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A navigator\u0027s map\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A systematic non-narrative presentation of data\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A tabular presentation of data; a table\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A diagram\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A graph\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"author\u003dPaul title\u003d[http://www.economist.com/news/letters/21590879-britain-jfk-assassination-colombia-life-logging-fancy-words Letters: Say it as simply as passage\u003dCongratulations on managing to use the phrase “preponderant criterion” in a \u0027\u0027chart\u0027\u0027 (“[http://www.economist.com/news/united-states/21589427-states-are-starting-test-teachers-your-marks On your marks]”, November 9th). Was this the work of a kakorrhaphiophobic journalist set a challenge by his colleagues, or simply an example of glossolalia\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A record of a patient\u0027s diagnosis, care instructions, and recent history\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A ranked listing of competitors, as of recorded music\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A written deed; a charter\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A subspace of a manifold used as part of an atlas\", \"priority\":12}]}, \"synonyms\":{}}");

	add("charabanc", "{\"term\":\"charabanc\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|char-à-bancs||a carriage with benches|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A horse-drawn, and then later, motorized omnibus with open sides, and often, no roof\", \"priority\":1}]}, \"synonyms\":{}}");

	add("characteristicness", "{\"term\":\"characteristicness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|characteristic|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being characteristic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("characterlessness", "{\"term\":\"characterlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|characterless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state or condition of being characterless; lack of character\", \"priority\":1}]}, \"synonyms\":{}}");

	add("charade", "{\"term\":\"charade\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|charade|lang\u003den}}, of disputed origin.\u0026lt;!-- Sources differ on the origin of French \u0026quot;charade\u0026quot;: Century 1911: unknown origin; Webster 1913: confer Pr. charrada long chat, It ciarlare to chat; M-W online: an Occitan origin; Encarta: Provençal, a dialect of Occitan. --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A specific kind of riddle in which a word or phrase to find is split in several parts that can each be guessed from a verbal clue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A party game in which players mime a word, phrase, or name that the other players must try to guess\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something apparently real but based on pretence/pretense\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She said she loved me but it was only a \u0027\u0027charade\", \"priority\":4}]}, \"synonyms\":{}}");

	add("charades", "{\"term\":\"charades\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A game in which participants act out a word or phrase without talking for others to guess\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1909\u0027\u0027, Booth Tarkington, \u0027Beasley\u0027s Christmas Party\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"it looked like a house where they played \u0027\u0027charades\u0027\u0027, where there would be long streamers of evergreen and dozens of wreaths of holly at Christmas-time, where there were tearful, happy weddings and great throwings of rice after little brides\", \"priority\":3}]}, \"synonyms\":{}}");

