	add("charcoal", "{\"term\":\"charcoal\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027charcole\u0027 from \u0027charren\u0027 (lang\u003denm) + \u0027cole\u0027 (lang\u003denm) from Old english (ca. 450-1100) \u0027cierran\u0027 (to change, turn) + \u0027col\u0027 (coal) equivalent to {{compound|char|coal|lang\u003den}}. More at ajar, coal.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Impure carbon obtained by destructive distillation of wood or other organic matter, that is to say, heating it in the absence of oxygen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A stick of black carbon material used for drawing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A drawing made with charcoal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A very dark gray colour\", \"priority\":4}]}, \"synonyms\":{}}");

