	add("chargemaster", "{\"term\":\"chargemaster\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|charge|master|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a comprehensive list maintained by a hospital of prices of goods and services it will bill to its patients and their respective health insurers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The patient faced bankruptcy because she couldn\u0027t pay off the hundreds of thousands of dollars accrued from her hospital bill, including a price from the \u0027\u0027chargemaster\u0027\u0027 for a single acetaminophen pill at ten times the cost for the same pill over-the-counter at a pharmacy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"publisher\u003dw:American College of Healthcare American College of Healthcare year\u003d2007|passage\u003dMuch ink has been spilt bemoaning that incomprehensible foundation of hospital cost accounting and prices, the redoubtable \u0027\u0027chargemaster\", \"priority\":3}]}, \"synonyms\":{}}");

	add("charger", "{\"term\":\"charger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|charge}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device that charges or recharges\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Put the batteries in the \u0027\u0027charger\u0027\u0027 overnight so we can use them tomorrow\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large horse trained for battle and used by the cavalry. They were of a lighter build than a destrie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The knight rode a white \u0027\u0027charger\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A large platter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And she, being before instructed of her mother, said, Give me here John Baptist\u0027s head in a \u0027\u0027charger\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fancy restaurant used a white porcelain \u0027\u0027charger\u0027\u0027 when serving\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"One who charges\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A speedloader that holds several cartridges together in a single unit for easier loading of a firearm\u0027s magazine\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A rectal concealment container for prohibited material such as money, drugs and tools\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, w:Man on Fire (2004 Man on Fire, 01:44:10\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"quot;See this? This is a \u0027\u0027charger\u0027\u0027. It\u0027s used by convicts to hide money and drugs. They stick it in their body, they tuck it up their rectum.\u0026quot\", \"priority\":12}]}, \"synonyms\":{}}");

