	add("charivari", "{\"term\":\"charivari\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027charivari\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The noisy banging of pots and pans as a mock serenade to a newly married couple, or similar occasion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 94\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The marriage ceremony was given primordial significance over folkloric pre-marriage engagement rituals and wild \u0027\u0027charvaris\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any loud, cacophonous noise or hubbub\", \"priority\":4}]}, \"synonyms\":{}}");

	add("charlady", "{\"term\":\"charlady\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027char\u0027 () + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman who cleans houses and offices as an occupation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:H. C. Herman Cyril McNeile, \u0027s:Bull-dog Drummond/Chapter Bull-dog Drummond\u0027, Chapter 9: In Which He Has a Near Shave\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Then we\u0027ll move.\u0026quot; And Peter, watching the car resignedly from the window, saw the American grip his seat with both hands, and then raise them suddenly in silent prayer, while an elderly \u0027\u0027charlady\u0027\u0027 fled with a scream to the safety of the area below\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, Frank Swinnerton, \u0027\u0027\u0027Charladies\u0027\u0027\u0027, in \u0027Tokefield Papers, Old and New\u0027, charladies%22\u0026amp;hl\u003den\u0026amp;ei\u003dw9wVTueyMKrPmAX22cww\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDUQ6AEwA\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"charladies%22\u0026amp;f\u003dfalse page 163\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"MOST of the \u0027\u0027charladies\u0027\u0027 to be met with in novels and plays are comic characters. This ridicule of a whole class does not mean that novelists and dramatists hate \u0027\u0027charladies\u0027\u0027, but only that the novelist and dramatist is never quite master of his own book or his own play\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Owen Gibson, \u0027The Guardian\u0027, 8 Dec 2005\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He is shown choking back tears as he discovers that his great, great, great grandmother was a \u0027\u0027charlady\u0027\u0027 in Scotland who died in her thirties of tuberculosis and exhaustion\", \"priority\":8}]}, \"synonyms\":{}}");

	add("charlatanism", "{\"term\":\"charlatanism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|charlatan|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being a charlata\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, Benjamin Ridge, \u0027Ourselves, Our Food, and Our Physic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It will cure by science and philosophy instead of empiricism, and will deal the deadliest blow to \u0027\u0027charlatanism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An act of a charlatan\", \"priority\":4}]}, \"synonyms\":{}}");

