	add("charlene", "{\"term\":\"charlene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A feminine form of Charles coined in the nineteenth century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"best used in the U.S. in the 1940s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027 Roderick Peter MacIntyre: \u0027Takes: Stories for Young Adults\u0027, Thistledown Press, ISBN 1895449545, page 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Be grateful for our blessings, Charlie.\u0026quot; My name\u0027s really \u0027\u0027Charlene\u0027\u0027. Sounds like a southern romance, Fabio drooling over \u0027\u0027Charlene\u0027\u0027s heaving bosom. I\u0027m no \u0027\u0027Charlene\u0027\u0027, even at fourteen\", \"priority\":3}]}, \"synonyms\":{}}");

