	add("charnel", "{\"term\":\"charnel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|charnel}}, from {{m|la|carnāle||graveyard}}, from Latin {{m|la|carnālis}}, or possibly an alteration of Anglo-norman {{m|fro|charner}}, from {{m|la|carnārium||charnel}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chapel attached to a mortuary\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A repository for dead bodies\", \"priority\":2}]}, \"synonyms\":{}}");

