	add("charpoy", "{\"term\":\"charpoy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Persian\", \"Urdu\"], \"text\":\"From Urdu \u0027چارپای\u0027 from Persian \u0027چهارپای\u0027 (four-footed)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of common bedstead in India\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘To be Filed for Reference’, \u0027Plain Tales from the Hills\u0027, Folio Society 2004, p. 213\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Here is a \u0027\u0027charpoy\u0027\u0027 on which two can sit, and it is possible that there may, from time to time, be food in that platter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Aravind Adiga, \u0027The White Tiger\u0027, Atlantic 2009, p. 54\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There, every morning, tens of thousands of young men sit in the tea shops, reading the newspaper, or lie on a \u0027\u0027charpoy\u0027\u0027 humming a tune, or sit in their rooms talking to a photo of a film actress\", \"priority\":5}]}, \"synonyms\":{}}");

