	add("chaser", "{\"term\":\"chaser\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027chaceür\u0027 \u0027chaceor\u0027 (French \u0027chasseur\u0027 , from \u0027chacier\u0027 (to chase, hunt) later senses from or influenced by {{suffix|chase|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or thing (ship, plane, car, etc.) that chases\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, David Oatman, \u0027Old Favorites, New Fun\u0027 (page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One student is the \u0027\u0027chaser\u0027\u0027 and the other is the chasee. Give the chasee three seconds to get away and then allow the chaser to attempt to tag the chasee\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Originally, a horse used for hunting; now, a horse trained for steeplechasing, a steeplechaser\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027: \u0027Betting for a Living\u0027 by Nick Mordin - Page 35\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;[I]t looked like The Fellow was the best steeplechaser in many years. He\u0027d earned the best speed rating I\u0027d ever given a \u0027\u0027chaser\u0027\u0027.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027: \u0027American Classic Pedigrees 1914-2002\u0027 by Avalyn Hunter - Page 45\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;Wild Risk...had his greatest successes as a steeplechaser rather than a flat racer... It is rare indeed that a \u0027\u0027chaser\u0027\u0027 - even one as good as wild risk - makes a good flat sire.\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027: \u0027Sports Ticket: Live the Action!\u0027 by Sportsfile - Page 17\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"quot;Oh, that final furlong! It can be both agony and ecstasy. Anyone who doubts that should have seen the television close-up of Jim Lewis as his great \u0027\u0027chaser\u0027\u0027 Best Mate came up the final hill at Cheltenham in 2004 to clich a hat-trick of Gold Cups. ... Best mate is the best steeplechaser we have seen for years and all being well will be at the Cheltenham Festival again in 2005 to try and make it four Gold Cups.\u0026quot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A hunter\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Someone who chases metal; a person who decorates metal by engraving or embossing\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1863\u0027\u0027: \u0027The Employments of Women: A Cyclopaedia of Woman\u0027s Work\u0027 By Virginia Penn\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"quot;Mr B., heraldic \u0027\u0027chaser\u0027\u0027, says there are several processes in making heraldy plates, sketching, engraving, embossing, chasing and burnishing.\u0026quot; (page 100\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"quot;H. \u0026amp; C., manufacturers of cloth and gilt buttons, say it requires some weeks to learn to chase the gilt buttons, which are done with small metal tools and a hammer. \u0027\u0027Chasers\u0027\u0027 are paid by the peice, working ten hours a day, and some can earn $1 a day.\u0026quot\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027: \u0027Living Crafts\u0027 by George Bernard Hughes - page 3\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"quot;Flat chasing in sunken or low relief is a technique by which the ornament is formed by beating down the ground from the front. This is done in essentially the same manner as repoussé work, where the ornament appears in high relief, but the design is punched from the face of the silver plate. ... Sometimes, instead of applying a freehand design, the \u0027\u0027chaser\u0027\u0027 covers the greased suface with a paper pattern in which the design is pricked with pins.\u0026quot\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027: \u0027Silver\u0027 by Richard Came - Page\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"quot;Chasing in general can be distinguised from engraving, in that the design can be seen on the reverse or inside of the pieces. Having outlined the pattern on the surface, the \u0027\u0027chaser\u0027\u0027 cuts and at the same time slightly depresses the surface. A light hammer can be used in this process also.\u0026quot\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A tool used for cleaning out screw threads, either as an integral part of a tap or die to remove waste material produced by the cutting tool, or as a separate tool to repair damaged threads\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027: \u0027Machinery\u0027 (author(s) unknown) (Page 141\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"quot;In Fig. i is shown one of the \u0027\u0027chasers\u0027\u0027 in the position which it occupies in cutting a thread.\u0026quot\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027: \u0027Thread-cutting Methods: A Treatise on the Operation and Use of Various Tools and Machines for forming screw threads...\u0027 by Franklin Day Jones (Page 32\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"quot;Many screw threads are also finished completely with \u0027\u0027chasers\u0027\u0027 of this type, although they are not adapted for extremely acurate work unless the teeth are ground after hardening, because the pitch of the \u0027\u0027chaser\u0027\u0027 teeth is affected more or less by...\u0026quot\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: \u0027Handbook of Dimensional Measurement\u0027 by Francis T. Farago, Mark A. Curtis (p.467\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"quot;The category of thread cutting tools inlcudes both the single-point and multiple-point [\u0027\u0027chaser\u0027\u0027 type] lathe cutters.\u0026quot\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A mild drink consumed immediately after a drink of hard liquor\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027: \u0027Skiing the Americas\u0027, by John Clarkson Jay, p. [http://books.google.com/books?id\u003d8QeCAAAAMAAJ\u0026amp;q\u003d%22straight%2C+no+chaser%22\u0026amp;pgis\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"search_anchor 115\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"quot;Cowboys in high-heeled boots teeter along its sidewalks, or push the swinging doors aside for a shot or two — straight, no \u0027\u0027chaser\u0027\u0027.\u0026quot\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A shot of hard liquor\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Someone that follows logs out of the forest in order to signal a yarder engineer to stop them if they become fouled - also called a frogger\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027: \u0027Pamphlets on Logging Equipment\u0027 [author unknown] - Page 2\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"quot;...on one end known as a Bardon choker hook, to facilitate making a loop. It stays tight and makes it unnecessary for the \u0026quot;\u0027\u0027chaser\u0027\u0027\u0026quot; or \u0026quot;choker setter\u0026quot; to follow the \u0026quot;turn\u0026quot; to the landing as might have to be done if tongs are used\u0026quot\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"1913\u0027\u0027: \u0027Logging: The Principles and General Methods of Operation in the United States\u0027 by Ralph Clement Bryant - Page 21\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"quot;A \u0027\u0027chaser\u0027\u0027 follows the logs to the landing, often riding in a rigging sled hollowed out of a log, which is attached to the rear log. The \u0027\u0027chaser\u0027\u0027 can signal to the road engineer at any point...\u0026quot\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027: \u0027United States Shipping Board Emergency Fleet Corporation: Hearing Before the Committee on ...\u0027 by United States Congress. Senate. Committee on Commerc\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"quot;and the \u0027\u0027chaser\u0027\u0027 is the fellow whose job it is to follow along after these logs to...\u0026quot\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"one who unhooks chokers from the logs at the landing\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027: \u0027Holy Old Mackinaw: A Natural History of the American Lumber- Jack\u0027 by Stewart Hall Holbrook - Page 18\", \"priority\":40},{\"upperType\":\"NOUN\", \"text\":\"quot;The \u0027rigging slinger\u0027 hooks the chokers to the main line\u0027 the \u0027chaser\u0027 unhooks them at the spar tree.\u0026quot\", \"priority\":41},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027: \u0027Nobody Here But Us: Pioneers of the North\u0027 by Fred Moira Farrow - Page 17\", \"priority\":42},{\"upperType\":\"NOUN\", \"text\":\"A chaser was the man who unhooked the logs that were yarded in to the spar tree\", \"priority\":43},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027: \u0027Logging and Pulpwood Production\u0027 by John Kenneth Pearce, George Stenzel - Pages 242-24\", \"priority\":44},{\"upperType\":\"NOUN\", \"text\":\"quot;When the turn arrives at the landing, the \u0027\u0027chaser\u0027\u0027 directs the engineer where to drop the turn by hand signals. The \u0027\u0027chaser\u0027\u0027 then unhooks the chokers, gets in the clear, and singlas to reel in the haulback line\u0026quot\", \"priority\":45},{\"upperType\":\"NOUN\", \"text\":\"One of a series of adjacent light bulbs that cycle on and off to give the illusion of movement\", \"priority\":46},{\"upperType\":\"NOUN\", \"text\":\"A chase gun\", \"priority\":47},{\"upperType\":\"NOUN\", \"text\":\"bow \u0027\u0027chaser\u0027\u0027; stern \u0027\u0027chaser\", \"priority\":48}]}, \"synonyms\":{}}");

	add("chasey", "{\"term\":\"chasey\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"tag, the children\u0027s gam\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 Geoffrey Dutton, \u0027Out in the Open\u0027, Univ. of Queensland Press, p3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At recess we would play \u0027\u0027chasey\u0027\u0027 or kick a ball\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 Catherine Deveny, \u0027It\u0027s not my fault they print them,\u0027 Black Inc., p6\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Kids just want: a place to play \u0027\u0027chasey\u0027\u0027, some teachers who know their name and a few mates they can laugh and swap lunches with\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 Afsaneh Varzaly, \u0027I Will Not Cry: Undiscovered Greatness,\u0027 p13\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Timothy and Natalie ran back to their Mom asking her and Aden to come and play \u0027\u0027chasey\u0027\u0027 with them\", \"priority\":7}]}, \"synonyms\":{}}");

	add("chasmogamy", "{\"term\":\"chasmogamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The production of flowers that open and expose the stamens and styles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chasseur", "{\"term\":\"chasseur\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|chasseur|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A soldier equipped for rapid movement; also, any of several light infantry regiments, especially in France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A servant or attendant\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A hotel messenger, especially in France\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, Djuna Barnes, \u0027Nightwood\u0027, Faber \u0026amp; Faber 2007, p. 30\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027\u0027chasseur\u0027\u0027\u0027 of the Hôtel Récamier (whom he knew far too well) was approaching them at a run\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A style of cooking in which meat is cooked with a sauce containing mushrooms, shallots and white wine\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chastener", "{\"term\":\"chastener\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chasten|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who chastens\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chasuble", "{\"term\":\"chasuble\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) \u0027chesible\u0027 from late Latin \u0027casubla\u0027 an alteration of Latin \u0027casula\u0027 (little cottage, hooded cloak) a diminutive of \u0027casa\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The outermost liturgical vestment worn by clergy for celebrating Eucharist or Mass\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, translated by , from the 1856 French by , \u0027\u0027, part\u0026amp;nbsp;3, chapter\u0026amp;nbsp;10 ([http://www.gutenberg.org/ebooks/2413 ebook\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Day broke. He saw three black hens asleep in a tree. He shuddered, horrified at this omen. Then he promised the Holy Virgin three \u0027\u0027chasubles\u0027\u0027 for the church, and that he would go barefooted from the cemetery at Bertaux to the chapel of Vassonville\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1936\u0027\u0027, \u0027\u0027, chapter\u0026amp;nbsp;6 “Jabberwhorl Kronstadt”\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He has magenta eyes, like old-fashioned vest buttons; he’s mowsy and glaubrous, brown like arnica and then green as the Nile; he’s quaky and qualmy and queasy and teasy; he chews \u0027\u0027chasubles\u0027\u0027 and ripples rasubly\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chatathon", "{\"term\":\"chatathon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chat|athon|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A long period of chatting\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chatbot", "{\"term\":\"chatbot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A computer program that holds conversations through a chat room\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027chatbot\u0027\u0027 was quite simple yet informative\", \"priority\":2}]}, \"synonyms\":{}}");

	add("châteaux", "{\"term\":\"châteaux\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1877\u0027\u0027 September 15, F.P. Verney, “s:Littell\u0027s Living Age/Volume 134/Issue 1735/Pictures in Holland, on and off Pictures in Holland, on and off Canvas”, in \u0027Littell’s Living Age\u0027, volume 134, issue 1735\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Few cottages, no \u0027\u0027châteaux\u0027\u0027, hardly any inhabitants, were to be seen; it seemed as if we were reaching the very end of the world\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, Alberto Santos-Dumont, \u0027My Airships\u0027, page 15\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Villages and woods, meadows and \u0027\u0027châteaux\u0027\u0027, pass across the moving scene, out of which the whistling of locomotives throws sharp notes\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Alexis Lipsitz Flippin et al., \u0027Frommer’s Europe\u0027, page 329\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When royalty and nobility built \u0027\u0027châteaux\u0027\u0027 throughout this valley during the Renaissance, sumptuousness was uppermost in their minds.Category:English terms spelled with Â\", \"priority\":6}]}, \"synonyms\":{}}");

	add("chatelain", "{\"term\":\"chatelain\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027châtelain\u0027 itself from \u0027château|lang\u003dfr\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"castle-keeper, castellan\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chatiquette", "{\"term\":\"chatiquette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|chat|etiquette|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The etiquette dictating how one should behave in chat rooms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Jeffrey Jensen Arnett, \u0027Encyclopedia of Children, Adolescents, and the Media\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Each chat room functions in accordance with its own rules. They may be written rules in the form of \u0027\u0027\u0027chatiquette\u0027\u0027\u0027. Chatiquette prescribes what behavior is frowned upon and what the sanctions are\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Yvonne Jewkes, \u0027Dot.cons\u0027 (page 175\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As long as no one causes any offence to others in the room, and adheres to the basic rules of \u0027\u0027chatiquette\u0027\u0027, they can then remain in that room for as long as they wish, or until everyone else has left the room\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Irene Joos, ‎Ramona Nelson, ‎Marjorie J. Smith, \u0027Introduction to Computers for Healthcare Professionals\u0027 (page 479\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Chatiquette\u0027\u0027 is similar to netiquette in terms of the words and behavior acceptable while participating in a chat room\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Samuel Peterson, \u0027Bipolar Disease\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Never forget that a bipolar chat room has also its own rules, \u0027\u0027chatiquette\u0027\u0027, and guidelines. It is very important to understand it\", \"priority\":9}]}, \"synonyms\":{}}");

	add("chatoyancy", "{\"term\":\"chatoyancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chatoyant|cy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being chatoyant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("chatspeak", "{\"term\":\"chatspeak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|chat|speak|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The blend of informal language, conventional abbreviations and emoticons typical of chatrooms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Edward Castronova, \u0026quot;[http://downloads.planetmirror.com/pub/textfiles-pdf/academics/castronovavw.pdf Virtual Worlds: A First-Hand Account of Market and Society on the Cyberian Frontier],\u0026quot; \u0027CESifo Working Papers\u0027, 618, p. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Given that people are trying to speak by writing in real time, \u0027\u0027chatspeak\u0027\u0027 is infused with extensive abbreviations and there is little punctuation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Ronald A. Berk, \u0027Humor as an instructional defibrillator: evidence-based techniques in teaching and assessment\u0027, Stylus, p. 140\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Our students are using Internet shorthand or \u0027\u0027chatspeak\u0027\u0027 in their online yakking in chat rooms and e-mails\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0026quot;[http://community.livejournal.com/anti_illiteracy/1983.html Hello, All (who ever that is)]\u0026quot;, \u0027Smite the illiterate\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I don\u0027t mind saying \u0027u\u0027 instead of \u0027you\u0027 so much, mostly because I\u0027ve become numb to it, and some people do it because it\u0027s \u0027cool\u0027 to speak \u0027\u0027chatspeak\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Tom Breen, \u0027The Messiah formerly known as Jesus : dispatches from the intersection of Christianity and pop culture\u0027, Baylor University Press, p. 69\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Is it too much to imagine a Bible written entirely in the language of tomorrow: Internet \u0027\u0027chatspeak\u0027\u0027 and text message shorthand\", \"priority\":9}]}, \"synonyms\":{}}");

	add("chattel", "{\"term\":\"chattel\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027chatel\u0027 from Old french (842-ca. 1400) \u0027chatel\u0027 from {{m|la|capitāle}} (English \u0027capital\u0027 , from Latin {{m|la|capitālis||of the head}}, from \u0027caput\u0027 (head) + \u0027-alis\u0027 (-al) Compare \u0027cattle\u0027 () which is from an Anglo-Norman variant. Compare also \u0027\u0027 and \u0027kith and kine\u0027 () which also use “cow” to mean “property”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Tangible, movable property\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, w:Terry Terry Pratchett and w:Neil Neil Gaiman, \u0027Good Omens\u0027, Corgi, p.38\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"… although of course the firm had changed hands many times over the centuries, […] But the box has always been part of the \u0027\u0027chattels\u0027\u0027, as it were\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A slave\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027: Not all his servants and \u0027\u0027chattels\u0027\u0027 are wraiths! — JRR Tolkien, \u0027The Fellowship of the Ring\u0027 [Book 2, Chapter 1 - Many Meetings\", \"priority\":5}]}, \"synonyms\":{}}");

	add("chatterati", "{\"term\":\"chatterati\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|chatter|literati|lang\u003den}}, coined by Peter Simmons in 1989 and used in The Globe, a satirical newsletter for the Norwich-based Development and Environment Centre.{{rfe|Source for this 1989 coinage?|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"People who chat, argue and debate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002,\u0027\u0027 Annabelle Sreberny, “Trauma talk,” in \u0027Journalism After September 11,\u0027 Barbara Zelizer and Stuart Allan edd. [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;vid\u003dISBN0415287995\u0026amp;id\u003dzHs5FsL2pAIC\u0026amp;pg\u003dPA222\u0026amp;lpg\u003dPA222\u0026amp;sig\u003dxCPKCNE7rqbp3yj9eDEhIlq_94o\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The newspaper the \u0027Guardian,\u0027 together with its Sunday sister the \u0027Observer,\u0027 are the liberal papers of choice among the middle-class \u0027\u0027chatterati\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004,\u0027\u0027 John Mole, \u0027It\u0027s All Greek to Me\u0027 [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;vid\u003dISBN1857883438\u0026amp;id\u003dhK-jfsrSDcoC\u0026amp;pg\u003dPA74\u0026amp;lpg\u003dPA74\u0026amp;sig\u003dY8yHDBTWyUVeKsw3RifybeJbQwE\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Perhaps some Anatolian Leigh Fermor had a bestseller among the \u0027\u0027\u0027chatterati\u0027\u0027\u0027 of Topkapi with his \u0027Travels in the Egripos\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 Peter Simmons, in Fool on the Hill [htpp://www.oneworldnet.co.uk/blog/january2004.php/]Tuesday 20 January 2004 - political incorrectness and the \u0027\u0027\u0027chatterati\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 Christina Odone, in the Manchester \u0027Guardian\u0027, quoted in \u0027Credo\u0027 by Ray Pritchard [http://books.google.com/books?ie\u003dUTF-8\u0026amp;hl\u003den\u0026amp;vid\u003dISBN1581347197\u0026amp;id\u003duR7gKh4CWUIC\u0026amp;pg\u003dPA13\u0026amp;lpg\u003dPA13\u0026amp;sig\u003d58JatuzqcghLCAd6Tazni_ntH2U\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"From when to die to when to give birth, from whom to have sex with, to how to spend their money, the \u0027\u0027chatteratis\u0027\u0027 believe they should enjoy unlimited freedom\", \"priority\":8}]}, \"synonyms\":{}}");

	add("chatterbot", "{\"term\":\"chatterbot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|chatter|robot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An artificial intelligence program intended to simulate interactive conversation with another person\", \"priority\":1}]}, \"synonyms\":{}}");

